import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import ProtectedRoute from './ProtectedRoute';
import AuthService from './authService';
import RegistrationForm from './components/register/RegistrationForm';
import LoginForm from './components/login/LoginForm';
import ElectionsReg from './components/electionRegistry/electionRegForm';
import CreateElection from './components/electionCreate/electionCreate';
import CandidateAdd from './components/candidateAdd/candidateAdd';
import ParentComponent from './components/electionList/parentComp';
import ErrorPage from './ErrorPage';
import NotLoggedIn from './notLoggedin';
import NavigationBar from './components/navigationBar/NavigationBar';
import CandidatesParentComponent from './components/candidateList/CandidatesParentComponent';
import ElectionApplicationsParentComponent from './components/electionApplications/showApplicationsParent';
import ElectionDetails from './components/electionDetails/electionDetails';
import Logout from './logout';
import Parentresults from './components/resultsShow/resultsComp'
import ElectionResults from './components/resultsShow/ElectionResults';

const Home = () => {
  const [imageLoaded, setImageLoaded] = useState(false);
  const imagePath = '/home.png'; // Assuming 'images' is a directory in your public folder

  useEffect(() => {
    const image = new Image();
    image.src = imagePath;

    image.onload = () => {
      setImageLoaded(true);
    };
  }, [imagePath]);

  return (
    <div>
      <div
        style={{
          marginTop: '1%', // Adjust the percentage based on your design
          opacity: imageLoaded ? 1 : 0,
          transition: 'opacity 1s ease-in-out',
        }}
      >
        <img
          src={imagePath}
          alt="Displayed Image"
          style={{ width: '100%', height: '100%', maxWidth: '100%' }}
        />
      </div>
    </div>
  );
};

const OurTeam = () => <h2>OurTeam</h2>;

const Dashboard = () => <h2>Dashboard</h2>;
const Login = () => <LoginForm />;

const NotFound = () => <ErrorPage errorCode={404} />; // Customize this component as needed

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="/login" element={<Login />} />
        <Route path="/logout" element={<Logout />} />

        <Route path="/register" element={<RegistrationForm />} />
        <Route
          path="/home"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <Home />
                </>
              }
            />
          }
        />
        <Route
          path="/OurTeam"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <OurTeam />
                </>
              }
            />
          }
        />
        <Route
          path="/electionreg"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <ElectionsReg />
                </>
              }
            />
          }
        />
        <Route
          path="/myelections"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <ElectionDetails />
                </>
              }
            />
          }
        />
        <Route
          path="/results"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <Parentresults />
                </>
              }
            />
          }
        />
        <Route
          path="/results/:electionid"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <ElectionResults />
                </>
              }
            />
          }
        />

        <Route
          path="/electionslist"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <ParentComponent />
                </>
              }
            />
          }
        />
        <Route
          path="/electionApplications"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <ElectionApplicationsParentComponent />
                </>
              }
            />
          }
        />
        <Route
          path="/create"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <CreateElection />
                </>
              }
            />
          }
        />
        {/* Integrate dynamic parameter into /candidates route */}
        <Route
          path="/candidates/:electionid" // :electionid represents a dynamic parameter
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <CandidatesParentComponent />
                </>
              }
            />
          }
        />
        <Route
          path="/candadd/:electionid"
          element={
            <ProtectedRoute
              element={
                <>
                  <NavigationBar />
                  <CandidateAdd />
                </>
              }
            />
          }
        />
        <Route path="/notloggedin" element={<NotLoggedIn />} />
        {/* Catch-all route for handling non-existent routes */}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
};

export default App;
